import React from "react";
import { StyleSheet, Text, View, ActivityIndicator, Image, SafeAreaView, Button, Alert } from 'react-native';

const  MealPrepBox = ({foodItems}) => {

    const handlePress = () => {
        console.log("Text pressed")
    }

    const showAlert = () => 
    Alert.alert(
        "Alert Title",
        "My Alert Msg",
        [
            {
                text: "Cancel",
                onPress: () => Alert.alert("Cancel Pressed"),
                style: "cancel",
            },
        ],
    {
        cancelable: true,
        onDismiss: () =>
        Alert.alert(
            "This alert was dismissed by tapping outside of the alert dialog."
        ),
    }
    );

return (
    <SafeAreaView>
        <Text onPress={handlePress}>{foodItems}</Text>
        <Button onPress={showAlert} />
    </SafeAreaView>
)

}

export default MealPrepBox;
